  // Í∞Å Ïπ¥ÎìúÎ≥Ñ Ï¢ãÏïÑÏöî/Ïã´Ïñ¥Ïöî ÏÉÅÌÉú Ï†ÄÏû•
  const [reactions, setReactions] = useState({
    card1: null,
    card2: null,
    card3: null,
  });

  // ÌÅ¥Î¶≠ Ïù¥Î≤§Ìä∏ Ìï∏Îì§Îü¨
  const handleClick = (card, value) => {
    setReactions({ ...reactions, [card]: value });
    console.log(`${card} ‚Üí ${value === "like" ? "üëç Ï¢ãÏïÑÏöî" : "üëé Ïã´Ïñ¥Ïöî"}`);
  };

  return (
    <div style={styles.container}>
      <h2>üç± ÏùåÏãù Ï∂îÏ≤ú</h2>
      <p>Ïò§ÎäòÏùò Î™∏ ÏÉÅÌÉúÏóê ÎßûÏ∂ò ÎßûÏ∂§ ÏùåÏãù Ï∂îÏ≤úÏùÑ Ï†úÍ≥µÌï©ÎãàÎã§.</p>

      {/* 1Ô∏è‚É£ Îã≠Í∞úÏû• Î≥¥Ïö∏ */}
      <div style={styles.card}>
        <h4>Îã≠Í∞úÏû• Î≥¥Ïö∏</h4>
        <p>Îî∞ÎúªÌï® + Ìè¨ÎßåÍ∞ê</p>
        <div style={styles.btnGroup}>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card1 === "like" ? "#ffe47aff" : "white",
            }}
            onClick={() => handleClick("card1", "like")}
          >
            üëç
          </button>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card1 === "dislike" ? "#ffb4b4" : "white",
            }}
            onClick={() => handleClick("card1", "dislike")}
          >
            üëé
          </button>
        </div>
      </div>

      {/* 2Ô∏è‚É£ ÏàúÎëêÎ∂Ä Îã¨Í±ÄÌÉï ÏÑ∏Ìä∏ */}
      <div style={styles.card}>
        <h4>ÏàúÎëêÎ∂Ä Îã¨Í±ÄÌÉï ÏÑ∏Ìä∏</h4>
        <p>ÏÜåÌôî Ìé∏Ïïà + Ï†ÄÏûêÍ∑π</p>
        <div style={styles.btnGroup}>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card2 === "like" ? "#ffe47aff" : "white",
            }}
            onClick={() => handleClick("card2", "like")}
          >
            üëç
          </button>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card2 === "dislike" ? "#ffb4b4" : "white",
            }}
            onClick={() => handleClick("card2", "dislike")}
          >
            üëé
          </button>
        </div>
      </div>

      {/* 3Ô∏è‚É£ Ïó∞Ïñ¥ ÏïÑÎ≥¥Ïπ¥ÎèÑ ÎçÆÎ∞• */}
      <div style={styles.card}>
        <h4>Ïó∞Ïñ¥ ÏïÑÎ≥¥Ïπ¥ÎèÑ ÎçÆÎ∞•</h4>
        <p>Í±¥Í∞ïÌïú ÏßÄÎ∞© + Í∏∞Î∂Ñ ÏïàÏ†ï</p>
        <div style={styles.btnGroup}>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card3 === "like" ? "#ffe47aff" : "white",
            }}
            onClick={() => handleClick("card3", "like")}
          >
            üëç
          </button>
          <button
            style={{
              ...styles.btn,
              background:
                reactions.card3 === "dislike" ? "#ffb4b4" : "white",
            }}
            onClick={() => handleClick("card3", "dislike")}
          >
            üëé
          </button>
        </div>
      </div>

      {/* Í∑ºÍ±∞ ÏÑ§Î™Ö */}
      <div style={styles.reasonBox}>
        <h4>[Í∑ºÍ±∞ ÏÑ§Î™Ö]</h4>
        <p>"ÏòàÎØº + ÏãùÏöï Í∞êÏÜåÏùº ÎïåÎäî ÏûêÍ∑π ÎÇÆÏ∂îÍ≥† Î™∏ÏùÑ Îç∞Ïö∞Îäî Í≤ÉÏù¥ Ï¢ãÏïÑÏöî."</p>
      </div>

      <Navbar />
    </div>
  );
}

const styles = {
  container: {
    padding: "16px",
    paddingBottom: "100px",
    textAlign: "center",
    color: "#444444ff",
  },
  card: {
    background: "#fffd9bff",
    margin: "12px auto",
    padding: "20px",
    borderRadius: "12px",
    width: "80%",
    boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
  },
  btnGroup: {
    display: "flex",
    justifyContent: "center",
    gap: "10px",
    marginTop: "10px",
  },
  btn: {
    fontSize: "18px",
    background: "white",
    border: "1px solid #ccc",
    borderRadius: "8px",
    padding: "6px 14px",
    cursor: "pointer",
    transition: "all 0.2s ease",
  },
  reasonBox: {
    marginTop: "30px",
    background: "#f6f6f6",
    borderRadius: "10px",
    padding: "16px",
    width: "85%",
    marginLeft: "auto",
    marginRight: "auto",
    boxShadow: "0 1px 3px rgba(0,0,0,0.1)",
  },
};
